const axios = require('axios');

export const fetchSuggestionData = (url) =>{
    console.log(url)
    axios.get(url)
    .then(function (response) {
    // handle success
    console.log(response.data[0]);
    return response.data[0];
})
.catch(function (error) {
// handle error
console.log(error);
})
.then(function () {
// always executed
});

}
